//const iState = {name:"",email:"",phno:"",startDate:new Date()}
const iState = {users:[]}

const reducer = (state=iState, action) => {
    switch(action.type){
        case 'BOOK':
            return action.payload
        default:
            return state
    }
}

export default reducer
